import React from "react";
import { SafeAreaView, StyleSheet,Text,TouchableOpacity,View } from "react-native";

import { useNavigation}  from "@react-navigation/native";




export default function Noticia(){
    const navigation=useNavigation()
   
   return(
<SafeAreaView >
    <Text></Text>

    <TouchableOpacity onPress={() => navigation.navigate("Testo")}>
        <Text style={styles.input1}>Mudar</Text>
    </TouchableOpacity>
</SafeAreaView>

    );
}
const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: "#A96DFC",
    },
    
    input: {
        fontSize: 25,
        borderWidth: 1,
        marginTop: 90,
        padding: 7.5,
        marginBottom: 10,
        textAlign: "center",
        backgroundColor: "#AFFF8B"
    },
    input1: {
        fontSize: 25,
        borderWidth: 1,
        padding: 7.5,
        marginBottom: 5,
        textAlign: "center",
        backgroundColor: "#AFFF8B",
    },
})
